import { Nav, Container, Image, Row, Col, Form, NavDropdown, Navbar, Button, NavLink } from "react-bootstrap";
import logo from './img/magazine.svg';

const HeaderApp = () => {
    return (


        <Navbar>
            <Container fluid>
                <Navbar.Brand>Logo</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse>
                    <Nav>
                        <Nav.Link href="/">Home</Nav.Link>
                        <Nav.Link href="/post">Post</Nav.Link>
                        <NavDropdown title="Category">
                            <NavDropdown.Item>PC</NavDropdown.Item>
                            <NavDropdown.Item>Mobile</NavDropdown.Item>
                            <NavDropdown.Item>Console</NavDropdown.Item>
                            <Form.Control type="text" placeholder="Search" />
                            <Button variant="outline-success">Search</Button>
                        </NavDropdown>
                    </Nav>
                    <Nav>
                        <Nav.Link href="/login">Login</Nav.Link>
                        <Nav.Link href="/signup">Sign-up</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
};
export default HeaderApp;
